import {
    Box,
    Card,
    CardContent,
    CardMedia,
    Typography,
    Grid,
    Stack,
  } from "@mui/material";
import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { config } from "../App";
import WhatshotIcon from '@mui/icons-material/Whatshot';
const Homepage=()=>{
  // const dispatch = useDispatch();
  // const { recipe } = useSelector((state) => state.recipe);
 const [recipe,setRecipe] = useState()
  console.log(recipe)
  useEffect(() => {
   getRecipe();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  const getRecipe = async () => {
    let response = {};
    let errored = false;

    try {
      response = await (
        await fetch(`${config.endpoint}/recipe`, {
          method: "GET",
        })
      ).json();
    } catch (e) {
      errored = true;
      return errored;
    }
    setRecipe(response)

    // dispatch(getRecipe(response));
  };
  console.log("response",recipe)
  return (
        <Box>
             {typeof recipe !== "undefined" && (
          <Grid container spacing={2} sx={{ m: 2 }} style={{width:"95vw",paddingBottom:"30px",margin:"auto"}}>
            {recipe.map((ele) => {
              return (
                <Grid item xs={8} md={3} key={ele._id} className="recipe-grid">
                  {/* <Link to={"/video/" + ele._id} className="video-tile-link"> */}
                    <Card className="recipe-tile">
                      <CardMedia
                        // style={{ height: "300px" }}
                        component="img"
                        image={ele.image}
                        alt={ele.title}
                      />
                      <CardContent>
                        <Box>
                        <Typography
                          component="h5"
                          variant="h5"
                          
                        >
                          {ele.title}
                        </Typography>
                        </Box>
                        <Box style={{display:"flex",justifyContent:'space-between',padding:"10px"}}>
                        <Stack direction="row" alignItems="center">
                          <WhatshotIcon/>
                          <Typography
                            variant="subtitle1"
                            color="textSecondary"
                          >
                        {ele.calories}

                          </Typography>
                      </Stack>
                          <Typography
                            variant="subtitle1"
                            color="textSecondary"
                          >
                            {ele.prepTime}
                          </Typography>
                          </Box>
                      </CardContent>
                    </Card>
                  {/* </Link> */}
                </Grid>
              );
            })}
          </Grid>
          )}

      </Box>
    )
}
export default Homepage
